import { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { Directions } from './Directions'
import { FilterDirections } from './FilterDirections'
import { getCurrencies } from '../store/currenciesReducer'
import { directions, filter } from '../currenciesData'

function Currencies() {
    const directionsData = useSelector(state => state.currencies.directionsData)
    console.log(directionsData)
    const dispatch = useDispatch()

    useEffect(() => {
        dispatch(getCurrencies(directions))
        dispatch(getCurrencies(filter))
    })

    return (
        <div>
            <Directions />
            <FilterDirections />
        </div>
    )
}

export { Currencies }
